function Experience() {
  return (
    <section className="project py-5">
      <h2 className="pt-3 pb-1">Experience</h2>
        <ul className="p-0">
          <li className="py-2">
            <a href="#" ><h4>WebMull Vadodara, Gujarat, India  -  04/2022 - 12/2022</h4></a>
            <p>Developed and implemented front-end code using HTML, CSS, JavaScript to meet business requirements.</p>
            <p>Collaborated with the team to design new features for our web application and mobile app.</p>
            <p>Ensured that all code is well documented, reusable, efficient, and follows best practices.</p>
            <p>Participated in peer code reviews as appropriate for the task at hand and reviewed other's code when requested.</p>
            <p>Used Version control tools (Git, GitHub, Gitlab) appropriately depending on the task at hand and participated in daily standups when applicable.</p>
          </li>
        </ul>
    </section>
  );
}

export default Experience;
